INSERT INTO `questions` VALUES (1,1,'1. Qual é a página brasileira da Honda no Facebook focada exclusivamente em competições?','',0,0,'A página Honda Racing Brasil divulga as participações da nossa equipe em competições de duas rodas.','2018-09-19 02:57:14','2018-09-19 02:57:14'),(2,1,'2. Em qual continente é realizado o Rally Dakar, maior competição de rali do mundo?','',0,0,'Resposta: Até 2008, o Rally Dakar era realizado na Europa e na África, mas a partir de 2009 a competição passou a ser realizada na América do Sul.  <br>Fonte: https://www.foxsports.com.br/news/80764-conheca-a-historia-do-rali-dakar','2018-09-19 03:04:40','2018-09-19 03:05:36'),(3,1,'3. Qual dos pilotos abaixo não faz parte da equipe Honda?','',0,0,'Resposta: Andrea Dovizioso não é piloto da Honda. Ele faz parte da equipe da Ducati Team. <br> Fontes: http://www.hondaracingbrasil.com','2018-09-19 03:09:25','2018-09-19 03:09:25'),(4,1,'4. Quais os nomes dos pilotos Honda na Superbike 2018?','',0,0,'Resposta: A equipe Honda da Superbike é formada por Eric Granado, atual campeão da competição, e pelo Pedro Sampaio, que estreou esse ano na categoria 1000cc.','2018-09-19 03:13:45','2018-09-19 03:13:45'),(5,1,'5. Quantas vezes o piloto Marc Márquez foi campeão da principal categoria da MotoGP?','',0,0,'Resposta: O Marc Márquez foi campeão nos anos 2013, 2014, 2016 e 2017. Em nossa página Honda Brasil postamos a celebração do piloto, que além desses 4 títulos teve outros 2 em diferentes categorias. <br> Fonte: https://www.facebook.com/HondaBR/photos/a.305974739589274/779597792226964/','2018-09-19 03:21:21','2018-09-19 03:21:21'),(6,1,'6. Quais são os 3 conceitos do Respeito ao Indivíduo?','',0,0,'Resposta: O Respeito pelo Indivíduo baseia-se nos conceitos de Iniciativa, Igualdade e Confiança.  <br>Fonte: Manual “Filosofia Honda” e quis de LinkedIn: https://www.linkedin.com/feed/update/urn:li:activity:6440591334104453120','2018-09-19 03:24:03','2018-09-19 03:24:03'),(7,1,'7. Quais são as Crenças Fundamentais que fazem parte da Filosofia Honda?','',0,0,'Resposta: As Crenças Fundamentais, que são a essência de toda a Filosofia Honda, são o Respeito ao Indivíduo e As Três Alegrias. <br> Fonte: Manual de “Filosofia Honda”','2018-09-19 03:26:55','2018-09-19 03:26:55'),(8,1,'8. De acordo com a Filosofia Honda, o que seria a Alegria de Comprar?','',0,0,'Resposta: Mais do que adquirir um produto bom, proporcionar a Alegria de Comprar é exceder as expectativas dos clientes. <br> Fonte: Manual “Filosofia Honda”.','2018-09-19 03:33:20','2018-09-19 03:33:20'),(9,1,'9. O Princípio das Três Realidades nos ajuda a pesquisar e solucionar problemas por meio de três atitudes, sendo que a primeira é “ir ao Genba”. O que isso significa?','',0,0,'Resposta: O Princípio das Três Realidades instrui a “Ir ao Genba”, que é o lugar da ocorrência de fato, “conhecer o Genbutsu”, o objeto ou situação real, e “basear-se no Genjitsu”, ou seja, ser realista. <br>  Fonte: Manual “Filosofia Honda”.','2018-09-19 03:35:32','2018-09-19 03:39:23'),(10,1,'10. O Princípio da Honda diz: \"Em um espírito global, dedicamo-nos a oferecer produtos da mais alta qualidade, a um preço justo...\", como finaliza?','',0,0,'Resposta: O Princípio orienta que \"Em um espírito global, dedicamo-nos a oferecer produtos da mais alta qualidade, a um preço justo para a satisfação de nossos clientes em todo o mundo”. <br>  Fonte: Manual “Filosofia Honda”.','2018-09-19 03:41:26','2018-09-19 03:41:26'),(11,1,'11. Quais são os pilotos da Red Bull Toro Rosso Honda?','',0,0,'Resposta: O primeiro piloto Honda a competir na Fórmula 1 foi Ronnie Bucknum, que estreou em 1964 com o RA271.  <br> Fonte: http://www.enciclopediaf1.com.br/por_dentro_da_f1/motor-honda','2018-09-19 03:42:51','2018-09-19 03:42:51'),(12,1,'12. Qual o nome do local da foto abaixo?','034627201809195ba1c6939094c.png',0,0,'Resposta: A pista da foto é o Circuito de Suzuka, que foi projetada em 1962 para ser uma pista de testes da Honda.  <br> Fonte: https://www.formula1.com/en/racing/2018/Italy.html#circuit e <br> http://www.autoracing.com.br/f1-especial-gp-da-italia-video/','2018-09-19 03:46:27','2018-09-20 19:49:19'),(13,1,'13. Quem pode correr na Fórmula 1 usando o número 1?','',0,0,'Resposta: Só pode usar o número 1 no carro o piloto que for o atual campeão da Fórmula 1, mas é opcional.  <br> Fonte: http://globoesporte.globo.com/motor/formula-1/noticia/2014/01/fia-divulga-lista-com-numeracao-definitiva-dos-pilotos-da-formula-1.html','2018-09-19 03:48:34','2018-09-19 03:48:34'),(14,1,'14. Nas sextas-feiras antes da prova de GP, os pilotos têm direito a duas sessões de treino livre no circuito. Quanto tempo dura cada sessão?','',0,0,'Resposta: O treino livre de sexta-feira permite aos pilotos correr em duas sessões de 90 minutos cada, já no sábado podem fazer apenas uma sessão livre de 60 minutos pela manhã.  <br> Fonte: http://esporte.ig.com.br/automobilismo/f1/regulamento/','2018-09-19 03:52:12','2018-09-19 03:52:12'),(15,1,'15. Qual a nacionalidade dos pilotos da Red Bull Toro Rosso Honda?','',0,0,'Resposta: A equipe da Scuderia Toro Rosso, que a Honda é parceira, tem como pilotos o francês Pierre Gasly e o neozelandês Brendon Hartley. <br> Fonte: https://scuderiatororosso.redbull.com ','2018-09-19 03:53:18','2018-09-19 03:53:18'),(16,1,'16. Como é conhecida a curva de Interlagos indicada pelo número 2 no mapa abaixo?','035833201809195ba1c969b0743.png',0,0,'Resposta: A curva indicada pelo 2 é a S do Senna, pois foi o próprio piloto quem sugeriu esse formato de curva quando a pista foi reformada em 1989.<br>  Fonte: https://vejasp.abril.com.br/cidades/interlagos-curvas/','2018-09-19 03:58:33','2018-09-19 03:58:33'),(17,1,'17. Onde será a última etapa da temporada 2018 de Fórmula 1?','',0,0,'Resposta: A temporada 2018 de Fórmula 1 teve início em março no GP da Austrália e terminará em novembro no GP de Abu Dhabi, logo após o GP do Brasil. <br> Fonte: https://www.formula1.com/','2018-09-19 04:01:03','2018-09-19 04:01:03'),(18,1,'18. Há quantos anos a Honda conquistou o seu primeiro título de Fórmula 1 com o piloto brasileiro Ayrton Senna?','',0,0,'Resposta: Este ano a Honda completou 30 anos de seu primeiro título mundial com o piloto brasileiro Ayrton Senna na Fórmula 1. <br> Fonte: http://www.ayrtonsenna.com.br/ayrton-senna-mclarenf1-e-honda-confira-os-numeros-desta-parceria-de-sucesso-na-f-1/ ','2018-09-19 04:04:19','2018-09-19 04:04:19'),(19,1,'19. O que significa a bandeira abaixo?','Red_flag_f1.jpg',0,0,'Resposta: A bandeira vermelha sinaliza que a prova foi suspensa. Geralmente é usada por conta de acidentes graves ou problemas com as condições da pista. <br> Fonte: http://esporte.ig.com.br/automobilismo/f1/regulamento/','2018-09-19 04:19:19','2018-09-19 04:19:19'),(20,1,'20. Quais são as cores do STR13, veículo da Scuderia Toro Rosso?','',0,0,'Resposta: O STR13 é azul com detalhes vermelhos.  <br>Fonte: https://scuderiatororosso.redbull.com/en_INT','2018-09-19 04:22:36','2018-09-19 04:22:36'),(21,1,'1) Quais foram as “palavras-chave” divulgadas durante essa semana?','',0,0,'Não possui','2019-01-14 13:35:59','2019-01-14 13:35:59'),(22,1,'1) Quais foram as “palavras-chave” divulgadas durante essa semana?','',0,0,'Não possui','2019-01-17 02:29:28','2019-01-17 02:29:28'),(23,2,'1) Quais foram as “palavras-chave” divulgadas durante essa semana?','',0,0,'Não possui','2019-01-17 02:58:29','2019-01-17 02:58:29'),(24,2,'2) Em relação à qualidade dos produtos e serviços oferecidos pela Honda, como posso contribuir?','',0,0,'Não possui','2019-01-17 02:59:53','2019-01-17 02:59:53'),(25,2,'3) A Honda se compromete em proporcionar e manter um ambiente de trabalho seguro e agradável. Isso significa que:','',0,0,'Não possui','2019-01-17 03:00:58','2019-01-17 03:00:58'),(26,2,'4) Quais práticas podemos exercer para garantir e melhorar a segurança no ambiente de trabalho?','',0,0,'Não possui','2019-01-17 03:03:27','2019-01-17 03:03:27'),(27,2,'5) Você sabe qual o limite permitido por lei de tolerância para ingestão de bebidas alcóolicas antes e durante a condução de veículos?','',0,0,'Não possui','2019-01-17 03:04:56','2019-01-17 03:04:56'),(28,2,'6) Você sabe quais são as penalidades para quem utiliza o celular ao volante?','',0,0,'Não possui','2019-01-17 03:07:03','2019-01-17 03:07:03'),(29,2,'7) Você sabe realizar a coleta seletiva corretamente? Em quais coletores (lixeiras) devemos jogar os seguintes resíduos (nesta ordem):\n\n1 - Latas (refrigerantes / suco / energéticos) de alumínio;\n2 - Cascas de frutas e chicletes; \n3 - Garrafinhas de água de plástico;','',0,0,'Não possui','2019-01-17 03:09:51','2019-01-17 03:09:51');
